Chinese string:
The extended device functions supported by the device currently include the following functions (each function is separated by an English ","):
 Tec, supports TEC function, i.e., generator temperature control device;
 AdvancedLightSoundControl, supports advanced sound and light control function, which needs to correspond to the motion control board program and cannot be modified at will;
 Tec2, supports TEC2 function, i.e., detector temperature control device;

direction encoder working mode, all supported working modes are as follows: 
 None, no counter; 
 Mode1X, encoder 1x counting mode; 
 Mode2X, encoder 2x counting mode; 
 Mode4X, encoder 4x counting mode.

Y direction encoder working mode, all supported working modes are as follows: 
 None, no counter; 
 Mode1X, encoder 1x counting mode; 
 Mode2X, encoder 2x counting mode; 
 Mode4X, encoder 4x counting mode.
